import React from 'react'
import { Parallax, Background } from 'react-parallax';
import styled from 'styled-components';

const Styles = styled.div`
    #container {
        display: flex;
        flex-direction: row;
        justify-content: center;
        align-items: center;
        position: absolute;
        bottom: 0;
        left: 0;
        width: 100vw;
        height: 95vh;
        padding: 5vh;
    }
    #profile {
        width: 44vh;
        height: 33vh;
        -webkit-box-shadow: 0px 43px 5px 30px rgba(110,52,110,1);
        -moz-box-shadow: 0px 43px 5px 30px rgba(110,52,110,1);
        box-shadow: 0px 43px 5px 30px rgba(110,52,110,1);
        border: 3vh solid white;
        border-radius: 5px;
    }
`;

export const Home = () => (
    <Styles>
        <Parallax
            bgImage={require('./assets/mountains.jpg')} strength={500}
        >
            <div style={{ width: '100%', height:'100vh'}}>
                <div id="container">
                    <div id = "image">
                        <img src={require('./assets/profile.png')} id="profile"></img>
                    </div>
                    <div>
                        description
                    </div>
                </div>
            </div>
        </Parallax>
    </Styles>

)
